import Board from "../Board/Board";
import ToolsBar from "../ToolsBar/ToolsBar";
import classes from "./Main.module.css";

const Main = () => {
  return (
    <main>
      <div className={classes.Main}>
        <ToolsBar />
        <Board />
      </div>
    </main>
  );
};

export default Main;
